export class HubClient {
    constructor(api) {
        this.hubAPI = api;
    }
    changeSelectedTab(tabIdx) {
        this.hubAPI.changeSelectedTab(tabIdx);
    }
    getSelectedTab() {
        return this.hubAPI.getSelectedTab();
    }
    getTabsList() {
        return this.hubAPI.getTabsList();
    }
}
